import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';

function ncard(val) {
  return (<Card
    imgsrc={Sdata[0].imgsrc}
    title={Sdata[0].title}
    sname={Sdata[0].sname}
    link={Sdata[0].link}
  />
  );
}

ReactDOM.render(
  <>
    <h1 className='heading_style'>List of top Three Netfilx Series</h1>

    Sdata.map(ncard);
  </>,
  document.getElementById("root")
);
